(function () {
    'use strict';

    angular
        .module('reelr.core', [])
        .factory('moviesFactory', ['$http', '$q', function($http, $q) {
        
	    	var service = {
	    		getMovies: getMoviesSpec,
	    		searchMovie: searchMovie
	    	};

	    	return service;

	        function getMovies() {
	        	return $http.get("/api/movies")
	        		.then(moviesSuccess)
	        		.catch(moviesError);
	        }

	        function getMoviesSpec() {
	        	return $q.resolve({
	        		movies: [
		        		{
							director : "John Lasseter",
							duration : "81 min",
							genre : "Animation, Adventure, Comedy",
							id : "tt0114709",
							path : "/var/www/media/Movies/Toy Story/Toy Story 1995.mp4",
							plot : "A cowboy doll is profoundly threatened and jealous when a new spaceman figure supplants him as top toy in a boy's room.",
							poster : "data:image/jpeg;base64,",
							poster_url : "http://ia.media-imdb.com/images/M/MV5BMTgwMjI4MzU5N15BMl5BanBnXkFtZTcwMTMyNTk3OA@@._V1_SX300.jpg",
							title : "Toy Story",
							year : "22 Nov 1995"
		        		},
		        		{
							director : "John Lasseter, Ash Brannon, Lee Unkrich",
							duration : "92 min",
							genre : "Animation, Adventure, Comedy",
							id : "tt0120363",
							path : "/var/www/media/Movies/Toy Story 2/Toy Story 2 1999.mp4",
							plot : "When Woody is stolen by a toy collector, Buzz and his friends vow to rescue him, but Woody finds the idea of immortality in a museum tempting.",
							poster : "data:image/jpg;base64,",
							poster_url : "http://ia.media-imdb.com/images/M/MV5BMTQ0OTU0NTcyNl5BMl5BanBnXkFtZTcwOTk5Mjc4OA@@._V1_SX300.jpg",
							title : "Toy Story 2",
							year : "24 Nov 1999"
						},
						{
							director : "Lee Unkrich",
							duration : "103 min",
							genre : "Animation, Adventure, Comedy",
							id : "tt0435761",
							path : "/var/www/media/Movies/Toy Story 3/Toy Sory 3.m4v",
							plot : "The toys are mistakenly delivered to a day-care center instead of the attic right before Andy leaves for college, and it's up to Woody to convince the other toys that they weren't abandoned and to return home.",
							poster : "data:image/jpg;base64,",
							poster_url : "http://ia.media-imdb.com/images/M/MV5BMTgxOTY4Mjc0MF5BMl5BanBnXkFtZTcwNTA4MDQyMw@@._V1_SX300.jpg",
							title : "Toy Story 3",
							year : "18 Jun 2010"
						}
	        		]
	        	});
	        }

	        function searchMovie(movie) {
	        	return $http.get("/api/movies/" + movie)
	        		.then(moviesSuccess)
	        		.catch(moviesError);
	        }

	        function moviesSuccess(res) {
	        	return res.data;
	        }

	        function moviesError(err) {
	        	return $q.reject(err);
	        }
    	}])
    	.factory('dataFactory', [function() {
        
	    	var service = {
	    		storageSupported: storageSupported,
	    		addToStorage: addToStorage,
	    		retrieveFromStorage: retrieveFromStorage
	    	};

	    	return service;

	        function storageSupported() {
				return typeof(Storage) !== "undefined" ? true : false
	        }

	        function addToStorage(key, val) { 
	        	localStorage.setItem(key, val);
	        }

	        function retrieveFromStorage(key) {
	        	return localStorage.getItem(key);
	        }
    	}]);
})();
